40234375, 109.15907287597656, -16.934219360351562], [-85.13304138183594, -0.4061851501464844, 46.236263275146484], [-89.51620483398438, 16.441017150878906, -82.9248046875], [-31.791465759277344, 21.943038940429688, 55.605010986328125], [-63.25153350830078, 39.34040832519531, 18.286396026611328], [-21.842756271362305, 56.053611755371094, -58.16747283935547], [-127.05963897705078, 29.21377944946289, -21.500812530517578], [-36.771240234375, 26.488813400268555, -31.282485961914062], [-95.54803466796875, -16.4510440826416, 29.450862884521484], [-94.55265045166016, 63.721282958984375, 73.93745422363281], [-138.5359649658203, -1.2957649230957031, 32.69513702392578], [-31.125347137451172, 10.410087585449219, 20.512001037597656], [-73.44320678710938, 10.1704683303833, -4.3860931396484375], [-45.37070083618164, 15.752510070800781, -16.540843963623047], [-117.98798370361328, 42.415340423583984, -39.017974853515625], [-93.76432800292969, 57.75006866455078, -9.828128814697266], [-167.25332641601562, 88.38663482666016, -17.951862335205078], [-125.74301147460938, 29.631061553955078, -32.0916748046875], [-46.406402587890625, 28.725988388061523, -21.368175506591797], [-54.062652587890625, 48.99365997314453, 6.214756011962891], [-92.2004623413086, 14.9260892868042, 36.57075881958008], [-62.50550079345703, -14.110239028930664, -15.693790435791016], [-139.2458038330078, 59.48329162597656, -33.7779541015625], [-191.16693115234375, -23.817323684692383, 12.056953430175781], [-123.5501480102539, 16.34737777709961, -62.77461242675781], [-86.56653594970703, 15.63851261138916, -13.339759826660156], [-68.25518798828125, -36.474693298339844, -5.18939208984375], [-146.74945068359375, 29.6551456451416, -55.80509948730469], [-18.141254425048828, 44.91844177246094, -117.13111114501953], [-192.32003784179688, 21.444168090820312, -11.97519302368164], [-186.99749755859375, 67.79704284667969, -13.215423583984375], [-86.05815124511719, -19.342069625854492, 13.732477188110352], [-79.09449768066406, 71.22838592529297, -69.94246673583984], [-222.31179809570312, 29.60692024230957, 16.983243942260742], [-80.91680145263672, 15.943055152893066, 42.4351921081543], [-176.3824462890625, 27.47806739807129, 7.5974884033203125], [-128.7274627685547, 13.146685600280762, 81.47276306152344]], "in_top10": true, "has_gt": false, "status": "fake", "color": "#cc0000", "euc_rank": 1, "euc_dist": 218.6658935546875, "gt_count": 0, "gap": 111.32454681396484, "radii": [76.21378379465817, 83.38474078356529, 90.9552950208495], "eigenvectors": [[0.07813842340488027, 0.4283099777086864, -0.9002471603859596], [0.9940808342877221, 0.03489704783908574, 0.10288581512503599], [0.0754829894057341, -0.9029577836462237, -0.42304793967477583]]}];

        let showPoints = true;
        let showEllipsoids = false;

        function createPlot() {
            const traces = [];

            // Query point
            traces.push({
                x: [queryPoint[0]],
                y: [queryPoint[1]],
                z: [queryPoint[2]],
                mode: 'markers',
                type: 'scatter3d',
                name: 'Query',
                marker: {
                    size: 12,
                    color: '#0066ff',
                    symbol: 'diamond',
                    line: { color: '#fff', width: 2 }
                },
                hovertemplate: '<b>QUERY</b><extra></extra>'
            });

            // GT points
            traces.push({
                x: gtPoints.map(p => p[0]),
                y: gtPoints.map(p => p[1]),
                z: gtPoints.map(p => p[2]),
                mode: 'markers+text',
                type: 'scatter3d',
                name: 'GT Neighbors',
                marker: {
                    size: 8,
                    color: '#00ff88',
                    symbol: 'square',
                    line: { color: '#000', width: 1 }
                },
                text: gtInfo.map(g => g.rank.toString()),
                textposition: 'top center',
                textfont: { size: 10, color: '#fff' },
                hovertemplate: gtInfo.map(g => 
                    `<b>GT #${g.rank}</b><br>ID: ${g.id}<br>Cluster: ${g.cluster}<extra></extra>`
                )
            });

            // Lines from query to GT
            gtPoints.forEach((gt, i) => {
                traces.push({
                    x: [queryPoint[0], gt[0]],
                    y: [queryPoint[1], gt[1]],
                    z: [queryPoint[2], gt[2]],
                    mode: 'lines',
                    type: 'scatter3d',
                    name: '',
                    showlegend: false,
                    line: { color: 'rgba(0, 255, 136, 0.3)', width: 1 },
                    hoverinfo: 'skip'
                });
            });

            // Clusters
            clusters.forEach(cluster => {
                // Cluster points
                if (showPoints) {
                    traces.push({
                        x: cluster.points.map(p => p[0]),
                        y: cluster.points.map(p => p[1]),
                        z: cluster.points.map(p => p[2]),
                        mode: 'markers',
                        type: 'scatter3d',
                        name: `C${cluster.cid} points`,
                        visible: showPoints ? true : 'legendonly',
                        marker: {
                            size: 2,
                            color: cluster.color,
                            opacity: 0.4
                        },
                        hovertemplate: `Cluster ${cluster.cid}<extra></extra>`
                    });
                }

                // Centroid
                traces.push({
                    x: [cluster.centroid[0]],
                    y: [cluster.centroid[1]],
                    z: [cluster.centroid[2]],
                    mode: 'markers+text',
                    type: 'scatter3d',
                    name: `C${cluster.cid} centroid`,
                    marker: {
                        size: 10,
                        color: cluster.color,
                        symbol: 'x',
                        line: { color: '#fff', width: 1 }
                    },
                    text: [`C${cluster.cid}`],
                    textposition: 'top center',
                    textfont: { size: 10, color: '#fff' },
                    hovertemplate: `<b>Cluster ${cluster.cid}</b><br>` +
                        `Status: ${cluster.status.toUpperCase()}<br>` +
                        `Rank: ${cluster.euc_rank}<br>` +
                        `Distance: ${cluster.euc_dist.toFixed(1)}<br>` +
                        `GT Count: ${cluster.gt_count}<br>` +
                        `Gap: ${cluster.gap.toFixed(1)}<extra></extra>`
                });

                // Line from query to centroid
                traces.push({
                    x: [queryPoint[0], cluster.centroid[0]],
                    y: [queryPoint[1], cluster.centroid[1]],
                    z: [queryPoint[2], cluster.centroid[2]],
                    mode: 'lines',
                    type: 'scatter3d',
                    name: '',
                    showlegend: false,
                    line: {
                        color: cluster.color,
                        width: 2,
                        dash: 'dash'
                    },
                    hoverinfo: 'skip'
                });

                // Ellipsoid surface (approximate with mesh)
                if (showEllipsoids) {
                    const ellipsoidTrace = createEllipsoid(
                        cluster.centroid, 
                        cluster.radii, 
                        cluster.eigenvectors,
                        cluster.color
                    );
                    traces.push(ellipsoidTrace);
                }
            });

            const layout = {
                scene: {
                    xaxis: { title: 'PC1', gridcolor: '#333', zerolinecolor: '#555' },
                    yaxis: { title: 'PC2', gridcolor: '#333', zerolinecolor: '#555' },
                    zaxis: { title: 'PC3', gridcolor: '#333', zerolinecolor: '#555' },
                    bgcolor: '#0a0a15',
                    camera: {
                        eye: { x: 1.5, y: 1.5, z: 1.5 }
                    }
                },
                paper_bgcolor: '#0a0a15',
                plot_bgcolor: '#0a0a15',
                font: { color: '#eee' },
                showlegend: false,
                margin: { l: 0, r: 0, t: 0, b: 0 }
            };

            Plotly.newPlot('plot3d', traces, layout, { responsive: true });
        }

        function createEllipsoid(center, radii, eigenvectors, color) {
            const n = 20;
            const u = [];
            const v = [];
            for (let i = 0; i <= n; i++) {
                u.push(i * Math.PI / n);
            }
            for (let j = 0; j <= n; j++) {
                v.push(j * 2 * Math.PI / n);
            }

            const x = [], y = [], z = [];
            for (let i = 0; i < u.length; i++) {
                const xRow = [], yRow = [], zRow = [];
                for (let j = 0; j < v.length; j++) {
                    const px = radii[0] * Math.sin(u[i]) * Math.cos(v[j]);
                    const py = radii[1] * Math.sin(u[i]) * Math.sin(v[j]);
                    const pz = radii[2] * Math.cos(u[i]);

                    // Rotate by eigenvectors
                    const rx = eigenvectors[0][0]*px + eigenvectors[0][1]*py + eigenvectors[0][2]*pz;
                    const ry = eigenvectors[1][0]*px + eigenvectors[1][1]*py + eigenvectors[1][2]*pz;
                    const rz = eigenvectors[2][0]*px + eigenvectors[2][1]*py + eigenvectors[2][2]*pz;

                    xRow.push(center[0] + rx);
                    yRow.push(center[1] + ry);
                    zRow.push(center[2] + rz);
                }
                x.push(xRow);
                y.push(yRow);
                z.push(zRow);
            }

            return {
                type: 'surface',
                x: x,
                y: y,
                z: z,
                opacity: 0.3,
                colorscale: [[0, color], [1, color]],
                showscale: false,
                hoverinfo: 'skip'
            };
        }

        function togglePoints(show) {
            showPoints = show;
            document.querySelectorAll('.control-btn').forEach(btn => btn.classList.remove('active'));
            event.target.classList.add('active');
            createPlot();
        }

        function toggleEllipsoids(show) {
            showEllipsoids = show;
            createPlot();
        }

        function resetCamera() {
            Plotly.relayout('plot3d', {
                'scene.camera': { eye: { x: 1.5, y: 1.5, z: 1.5 } }
            });
        }

        function focusCluster(cid) {
            const cluster = clusters.find(c => c.cid === cid);
            if (cluster) {
                Plotly.relayout('plot3d', {
                    'scene.camera': {
                        eye: {
                            x: cluster.centroid[0] / 50 + 1,
                            y: cluster.centroid[1] / 50 + 1,
                            z: cluster.centroid[2] / 50 + 1
                        },
                        center: {
                            x: cluster.centroid[0] / 100,
                            y: cluster.centroid[1] / 100,
                            z: cluster.centroid[2] / 100
                        }
                    }
                });
            }
        }

        // Populate sidebar
        function populateSidebar() {
            const clusterList = document.getElementById('cluster-list');
            const sortedClusters = [...clusters].sort((a, b) => a.euc_rank - b.euc_rank);

            sortedClusters.forEach(cluster => {
                const card = document.createElement('div');
                card.className = `cluster-card ${cluster.status}`;
                card.onclick = () => focusCluster(cluster.cid);
                card.innerHTML = `
                    <div class="cluster-header">
                        <span class="cluster-name">Cluster ${cluster.cid}</span>
                        <span class="cluster-status ${cluster.status}">${cluster.status}</span>
                    </div>
                    <div class="cluster-details">
                        <span>Rank: ${cluster.euc_rank}</span>
                        <span>Dist: ${cluster.euc_dist.toFixed(1)}</span>
                        <span>GT: ${cluster.gt_count}</span>
                        <span>Gap: ${cluster.gap.toFixed(1)}</span>
                    </div>
                `;
                clusterList.appendChild(card);
            });

            const gtList = document.getElementById('gt-list');
            gtInfo.forEach((gt, i) => {
                const item = document.createElement('div');
                item.className = 'gt-item';
                const inTop10 = clusters.some(c => c.cid === gt.cluster && c.in_top10);
                item.innerHTML = `
                    <span>#${gt.rank} (ID: ${gt.id})</span>
                    <span>C${gt.cluster} ${inTop10 ? '✓' : '✗'}</span>
                `;
                gtList.appendChild(item);
            });
        }

        // Initialize
        createPlot();
        populateSidebar();
    </script>
